import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Button from 'react-bootstrap/Button';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Home() {
  return (
    <>
      <div className="home">
        {/* Header with Background */}
        <div className="bg-blue-900 text-white py-12">
          <div className="text-center space-y-4">
            <h1 className="text-4xl font-extrabold mb-6 text-white shadow-lg">Welcome to Yuvi's Artistry</h1>

            {/* Overlapping Button Stack */}
            <div className="relative flex justify-center h-40 items-center">
              <Button variant="primary" className="btn-overlap z-30">Admin</Button>
              <Button variant="secondary" className="btn-overlap z-20 translate-x-5 translate-y-5">Artist</Button>
              <Button variant="success" className="btn-overlap z-10 translate-x-10 translate-y-10">Customer</Button>
            </div>
          </div>
        </div>

        <div className="max-w-6xl mx-auto px-4 py-8">
          <Carousel
            autoPlay
            infiniteLoop
            showThumbs={false}
            showStatus={false}
            className="mb-10"
          >
            {/* 🖼️ Custom static slides */}
            <div>
              <img src="/images/art1.jpg" alt="Art 1" className="w-full object-cover rounded-xl shadow-lg transform hover:scale-105 transition duration-500" />
              <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 1 - ₹999</p>
            </div>
            <div>
              <img src="/images/art2.jpg" alt="Art 2" className="w-full object-cover rounded-xl shadow-lg transform hover:scale-105 transition duration-500" />
              <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 2 - ₹1499</p>
            </div>
            <div>
              <img src="/images/art3.jpg" alt="Art 3" className="w-full object-cover rounded-xl shadow-lg transform hover:scale-105 transition duration-500" />
              <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 3 - ₹1999</p>
            </div>
            <div>
              <img src="/images/art4.jpeg" alt="Art 4" className="w-full object-cover rounded-xl shadow-lg transform hover:scale-105 transition duration-500" />
              <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 4 - ₹2499</p>
            </div>
            <div>
              <img src="/images/art5.jpeg" alt="Art 5" className="w-full object-cover rounded-xl shadow-lg transform hover:scale-105 transition duration-500" />
              <p className="legend text-lg bg-opacity-70 bg-black text-white p-2">Art Title 5 - ₹2999</p>
            </div>
          </Carousel>
        </div>
      </div>

      <style>{`
        .home {
          min-height: 100vh;
        }

        .btn-overlap {
          position: absolute;
          padding: 14px 28px;
          font-size: 1.1rem;
          font-weight: bold;
          border-radius: 12px;
          color: white;
          background: linear-gradient(45deg, #1e3c72, #2a5298);
          box-shadow: 0 8px 20px rgba(0, 0, 0, 0.25);
          transition: transform 0.3s ease, box-shadow 0.3s ease;
          cursor: pointer;
        }

        .btn-overlap:hover {
          transform: scale(1.05) translateY(-4px);
          box-shadow: 0 12px 24px rgba(0, 0, 0, 0.3);
        }

        .btn-overlap:focus {
          outline: none;
        }

        /* Custom color overrides */
        .btn-overlap.btn-primary {
          background: linear-gradient(45deg, #4CAF50, #2f855a);
        }

        .btn-overlap.btn-secondary {
          background: linear-gradient(45deg, #FF9800, #e65100);
        }

        .btn-overlap.btn-success {
          background: linear-gradient(45deg, #2196F3, #1976D2);
        }

        /* Title styles */
        h1 {
          text-align: center;
          color: #ffffff;
          text-shadow: 3px 3px 5px rgba(0, 0, 0, 0.3);
          background-color: blue;
        }

        .carousel .slide {
          background-color: #f3f4f6;
          width: 100%;
          height: 55vh;
        }

        .carousel .legend {
          font-size: 1.5rem;
          font-weight: 600;
          text-align: center;
          background: rgba(0, 0, 0, 0.7);
          color: white;
          padding: 12px;
          border-radius: 10px;
          margin-top: 5%;
          text-shadow: 1px 1px 4px rgba(0, 0, 0, 0.5);
        }

        .carousel .slide img {
          box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
          transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .carousel .slide:hover img {
          transform: scale(1.05);
          box-shadow: 0 6px 12px rgba(0, 0, 0, 0.3);
        }

        .carousel .thumb {
          border-radius: 8px;
        }

        /* Responsive adjustments */
        @media (max-width: 768px) {
          .btn-overlap {
            position: static !important;
            transform: none !important;
            margin: 10px auto;
            display: block;
          }

          h1 {
            font-size: 2.5rem;
          }

          .carousel .legend {
            font-size: 1.25rem;
            padding: 10px;
          }

          .carousel .slide {
            height: 65vh;
          }
        }

        @media (max-width: 480px) {
          .btn-overlap {
            font-size: 0.9rem;
            padding: 10px 20px;
          }

          h1 {
            font-size: 2rem;
          }

          .carousel .legend {
            font-size: 1rem;
            padding: 8px;
          }

          .carousel .slide {
            height: 55vh;
          }
        }
      `}</style>
    </>
  );
}
